import * as Rx from "rxjs/Rx";



@Injectable()
export class JS2JPrint {


   

    constructor(){
        let url = "ws://127.0.0.1:65505";

        this.create(url);    
        //this.testPrint();
    }

    private subject: Rx.Subject<any>;

    create(url)  {
        this.subject = Rx.Observable.webSocket(url);
        this.subject.retry().subscribe(
             (msg) => console.log('message received: ' + msg),
             (err) => console.log(err),
             () => console.log('complete')
           );
    }

    print (data : any) {
        this.subject.next(data);
    }
    
    
    testPrint(){
        let info = {
            data : this.testprint.trim(),
            printer : 'EPSON TM-T82 Receipt',
            type : 'pdf'
        };

        this.subject.next(info);
    }
        
    

     testprint = ""
}

@NgModule({
    providers: [JS2JPrint]
})
export class JS2JPrintModule {

}